function ExpenseItem() {
  return (
    <div>
      <div className="expense-item"> Aug 20 2022 </div>
      <div className="expense-item__description"> Car Insurance</div>
      <div className="expense-item__price"> Rs 120</div>
    </div>
  );
}

export default ExpenseItem;
